er Magere Melkpoeder, Zuu eregelaar: Citroenzuur Emulgator. E471, Aroma, Kleurstof: E100, Stabilisatoren E412, E407 E415 Suiker, Magere Melkpoeder, Mager Cacaopoeder, Emulgato: Sojalecithine, Aroma\'s). Kan sporen van noten bevatten. DEZITRONE UND LIMETTE GESCHMACK EIS AM BESCHICHTUNG.  Zutaten: Limette Geschmack (Wasser, Zucker, Dextrose, Säureregulator: Zitronensäure, Stabilisator: Guarkernmehl, Farben (E100, E141), Aroma. Zitrone ose. Buttermilchpulver Magermilchpulver Säureregulator: Zitronensäure, Emulgator E471, Aroma, Farbstoff: E100, Stabilisatoren E412, E407 E415 ). Schokolade r, Magerkakaopulver, Emulgator: Sojalecithin, Aromastoffe). Kann Spuren von Nüssen enthalten', 'https://static.openfoodfacts.org/images/products/503/848/688/0019/front_en.13.400.jpg', '5.1', '4.7', '18.7', '18.5', '', '0.9', '0.04', '0.015748031496063', '', '0');

